  \"Investigation of Contaminant Effects on Frog Development at Great Bay National
  Wildlife Refuge, Newington, NH\",\n\t\"tracking_summary\": {\n\t\t\"total\": 7,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:42:07.247400\",\n\t\"name\": \"investigation-of-contaminant-effects-on-frog-development-at-great-bay-national-wildlife-re\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Beginning in 1997, the U.S. Fish and Wildlife
  Service Northeast Region (Region 5) Environmental Contaminants Program began investigating
  the prevalence of abnormalities in frogs on National Wildlife Refuges. In the Northeast,
  attention has focused on Great Bay National Wildlife Refuge in Newington, NH due
  to observations of abnormalities greater than 9% on three occasions, two die offs,
  and the results of toxicity tests with the African clawed frog, Xenopus laevis.
  Here we report the results of an On-Refuge Investigation that started in 2003 and
  ended in 2005 and describe the results of abnormality sampling between 1997 and
  2005. The study, which focused on four Refuge ponds: Beaver Pond, Ferry Way Pond,
  Lower Peverly Pond, and Stubbs Pond, was designed to address these broad questions:
  (1) Which chemicals in the sediments and water column are at concentrations that
  raise concern for adverse effects on amphibians? (2) Through controlled field and
  laboratory exposures, can we detect any adverse effects on survival, growth, percent
  reaching metamorphosis, time to metamorphosis, or prevalence of abnormalities in
  the four ponds under investigation? (3) Do frogs from Great Bay show evidence of
  endocrine disruption that could result in an impaired ability to complete metamorphosis
  or to reproduce? And (4) Based on these studies, what management actions should
  be taken?  In answer to the four broad questions, we cannot link the observed abnormalities
  in frogs with one or more specific chemicals or chemical classes. Lately, the percentages
  of abnormalities has decreased to 3% or lower in most samplings, although at some
  ponds we frequently find lower than expected numbers of metamorphs.\",\n\t\"license_title\":
